import React from 'react';
import '../styles/global.css';
import bannerImage from '../assets/banner.jpg';

const HomePage = () => {
  return (
    <div className="home">
      <header className="hero">
        <img src={bannerImage} alt="Banner" />
      </header>
      <section>
        <h2>Introduction</h2>
        <p>Welcome to our Dubai Project website. Our mission is to enhance marketing and cooperation in Dubai through a comprehensive range of services and solutions.</p>
      </section>
      <nav>
        <ul>
          <li><a href="/services">Services</a></li>
          <li><a href="/real-estate">Real Estate</a></li>
          <li><a href="/medical-vacation">Medical Vacation</a></li>
          <li><a href="/business-solutions">Business Solutions</a></li>
        </ul>
      </nav>
    </div>
  );
};

export default HomePage;
